import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../auth/AuthContext';
import { db } from '../firebase/config';
import { collection, query, where, onSnapshot } from 'firebase/firestore';

function UserList() {
  const navigate = useNavigate();
  const { logout } = useAuth();
  const { users } = useAuth();
  const [logins, setLogins] = useState([]);
  

  useEffect(() => {
    // Escuchar cambios en la colección de logins
    const q = query(collection(db, "logins"));
    const unsubscribe = onSnapshot(q, (querySnapshot) => {
      const loginData = [];
      querySnapshot.forEach((doc) => {
        loginData.push({ id: doc.id, ...doc.data() });
      });
      setLogins(loginData);
    });

    return () => unsubscribe();
  }, []);

  const getUserLogins = (username) => {
    return logins
      .filter(login => login.username === username)
      .sort((a, b) => b.timestamp?.seconds - a.timestamp?.seconds);
  };

  return (
    <div className="dashboard-container">

       <button 
    onClick={() => navigate(-1)} // Vuelve a la página anterior
    className="floating-btn back"
    title="Volver"
  >
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="currentColor">
      <path d="M20 11H7.83l5.59-5.59L12 4l-8 8 8 8 1.41-1.41L7.83 13H20v-2z"/>
    </svg>
  </button>

  <button 
    onClick={logout}
    className="floating-btn logout"
    title="Cerrar sesión"
  >
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="currentColor">
      <path d="M10.09 15.59L11.5 17l5-5-5-5-1.41 1.41L12.67 11H3v2h9.67l-2.58 2.59zM19 3H5c-1.11 0-2 .9-2 2v4h2V5h14v14H5v-4H3v4c0 1.1.89 2 2 2h14c1.1 0 2-.9 2-2V5c0-1.1-.9-2-2-2z"/>
    </svg>
  </button>

      <h1>Usuarios Registrados</h1>
      
      <table className="user-table">
        <thead>
          <tr>
            <th>Nombre</th>
            <th>Usuario</th>
            <th>Rol</th>
            <th>Último Login</th>
            <th>Historial</th>
          </tr>
        </thead>
        <tbody>
          {users.map(user => {
            const userLogins = getUserLogins(user.username);
            const lastLogin = userLogins[0]?.timestamp?.toDate()?.toLocaleString();
            
            return (
              <tr key={user.username}>
                <td>{user.name}</td>
                <td>{user.username}</td>
                <td>{user.role}</td>
                <td>{lastLogin || 'Nunca'}</td>
                <td>
                  <button 
                    onClick={() => navigate(`/dashboard/user-logins/${user.username}`)}
                    className="detail-btn"
                  >
                    Ver
                  </button>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
      
      <button onClick={() => navigate('/dashboard')} className="back-btn">
        Volver al Dashboard
      </button>
    </div>
  );
}

export default UserList;
